pub enum IdentType {
    Ident(String),
    IdentType {
        ident: String,
        prim: Vec<IdentType>,
    },
    Struct(Vec<IdentTyped>),
    Primitive(Primitive),
    Function {
        params: Vec<IdentTyped>,
        ret_type: Box<IdentType>,
    },
    Error,
}

pub enum Expr {
    Unary(Unary),
    Binary {
        op: Operator,
        lhs: Box<Expr>,
        rhs: Box<Expr>,
    },
    Cond {
        then_expr: Box<Expr>,
        cond: Box<Expr>,
        else_expr: Box<Expr>,
    },
}

pub enum Unary {
    Primary(Primary),
    UnaryOp {
        op: Operator,
        expr: Box<Unary>,
    },
}

pub enum Primary {
    Literal(Literal),
    IdentVal {
        ident: String,
        prim: Vec<IdentVal>,
    },
    Grouping(Box<Expr>),
}

pub enum IdentVal {
    Selector(String),
    Arguments(Vec<Expr>),
    Index(Box<Expr>),
    Slice {
        start: usize,
        end: usize,
        step: usize,
    },
}

pub enum Stmt {
    If {
        cond: Expr,
        then_stmt: Vec<Stmt>,
        else_stmt: Option<Vec<Stmt>>,
    },
    While {
        cond: Expr,
        do_stmt: Vec<Stmt>,
    },
    Continue,
    Break,
    Return(Option<Expr>),
    VarDecl {
        ident_typed: IdentTyped,
        val: Expr,
    },
    ValDecl {
        ident_typed: IdentTyped,
        val: Expr,
    },
    Block(Vec<Stmt>),
    Tip(Tip),
    Expr(Expr),
    Assign {
        ident: String,
        op: Operator,
        rhs: Expr,
    },
}

pub enum ProgramStmt {
    Import {
        idents: Vec<IdentImport>,
        from: String,
    },
    FunDecl {
        export: bool,
        ident: String,
        params: Vec<IdentTyped>,
        ret_type: IdentType,
        stmt: Vec<Stmt>,
    },
    VarDecl {
        ident_typed: IdentTyped,
        val: Expr,
    },
    ValDecl {
        ident_typed: IdentTyped,
        val: Expr,
    },
    StructDecl {
        export: bool,
        ident: String,
        params: Vec<IdentTyped>,
    },
    TypeDecl {
        export: bool,
        ident: String,
        types: IdentType,
    },
    Stmt(Stmt),
}
